import styled from "styled-components";

export const ListStyle = styled.ul`
    list-style: none;
    padding: 0;
    margin: 0;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    width: 100%;
    height: 100%;
    overflow-y: auto;
    overflow-x: hidden;
    ::-webkit-scrollbar {
        width: 0.5em;
    }
    ::-webkit-scrollbar-track {
        background-color: #f1f1f1;
    }
`;
